import React, { Component } from 'react';
import './style.css';
import Job from './job';

class Work extends Component{
   constructor(){
    super()
   } 
   render(){
    return(
        <React.Fragment>
        <h1>MY WORK</h1>
        <Job/>
        <Job/>
        <Job/>
        </React.Fragment>
 
    )
   }
}
export default Work;
